	add("bramble", "{\"term\":\"bramble\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) \u0027brembel\u0027 from Old english (ca. 450-1100) \u0027bræmbel\u0027 from earlier \u0027brǣmel\u0027 \u0027brēmel\u0027 from dialectal Proto-germanic {{m|gem-pro|*brēmila-}} (compare West Frisian \u0027brommel\u0027 Flemish \u0027bramel\u0027 Low German \u0027brommelbeer\u0027 , diminutive of {{m|gem-pro|*brēm-}} (compare English \u0027broom\u0027 . More at {{l|en|broom}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Common blackberry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[https://openlibrary.org/works/OL10563347W The Three Corpse chapter\u003d5|passage\u003dThe hovel stood in the centre of what had once been a vegetable garden, but was now a patch of rank weeds. Surrounding this, almost like a zareba, was an irregular ring of gorse and \u0027\u0027brambles\u0027\u0027, an unclaimed vestige of the original common\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several closely related thorny plants in the genus \u0027Rubus\u0027, including blackberry and raspberry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any thorny shrub\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A cocktail of gin, lemon juice, and blackberry liqueur\", \"priority\":5}]}, \"synonyms\":{}}");

	add("brancher", "{\"term\":\"brancher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|branch|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which shoots forth branches; one who shows growth in various directions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A young owl or other raptor that is just too young to fly. So called because of the bird still clinging to the branches while practising flying movements with the wings.Category:en:Falconry\", \"priority\":2}]}, \"synonyms\":{}}");

