	add("brassard", "{\"term\":\"brassard\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027brassard\u0027 from \u0027bras\u0027 (arm)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An armor plate that protects the arm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An insignia or band worn around the upper arm\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027A Savage War of Peace\u0027, New York Review Books 2006, p. 26\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Muslims found not wearing the white \u0027\u0027brassards\u0027\u0027 as prescribed by the army were simply despatched on the spot\", \"priority\":4}]}, \"synonyms\":{}}");

