	add("bravado", "{\"term\":\"bravado\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"French \u0027bravade\u0027 (bragging or boasting) Which comes from Italian \u0027bravata\u0027 from verb \u0027bravare\u0027 (brag, boast) from \u0027bravo\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A swaggering show of defiance or courage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The angry customer stood in the middle of the showroom and voiced his complaints with loud \u0027\u0027bravado\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A false show of courage\", \"priority\":3}]}, \"synonyms\":{}}");

	add("bravery", "{\"term\":\"bravery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027braverie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Being brave, courageousness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A brave act\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Splendor, magnificence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In that day the Lord will take away the \u0027\u0027bravery\u0027\u0027 of their tinkling ornaments about their feet, and their cauls, and their round tires like the moon\", \"priority\":4}]}, \"synonyms\":{}}");

