	add("brawl", "{\"term\":\"brawl\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"middle high german (ca. 1050-1500)\", \"low german\", \"Dutch\"], \"text\":\"Middle english (1100-1500) \u0027brall\u0027 \u0026quot;brawl, squabble\u0026quot; from \u0027brallen\u0027 \u0026quot;to clamour, boast, quarrel\u0026quot;. Compare Middle high german (ca. 1050-1500) \u0027prālen\u0027 \u0026quot;to boast, flaunt\u0026quot; (German \u0027prahlen\u0027 \u0026quot;to vaunt, boast, flaunt\u0026quot;), Low german \u0027brallen\u0027 \u0026quot;to brag\u0026quot;, Dutch \u0027brallen\u0027 \u0026quot;to boast\u0026quot;, Danish \u0027bralle\u0027 \u0026quot;chatter, jabber\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Adriaen Brouwer, Bauernrauferei beim Kartenspiel (c. thumb|\u0027Bauernrauferei beim Kartenspiel\u0027 (\u0027Smallholders Playing Cards\u0027, \u0027c.\u0027 1630–1640) by Flemish painter w:Adriaen Adriaen Brouwe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fight, usually with a large number of people involved\", \"priority\":2}]}, \"synonyms\":{}}");

	add("brawn", "{\"term\":\"brawn\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"old norse\"], \"text\":\"From Middle english (1100-1500) \u0027brawne\u0027 from Old french (842-ca. 1400) \u0027braon\u0027 (slice of meat, fleshy part, buttock) from Frankish *\u0027\u0027 (brādon) accusative form of *\u0027\u0027 (brādo) from Proto-germanic {{m|gem-pro|*brēdô||meat, roast}}, from Proto-indo-european {{m|ine-pro|*bhre-||to burn, heat}}, from Proto-indo-european {{m|ine-pro|*bureue-||to boil, bubble, burn}}. Akin to Old high german (ca. 750-1050) \u0027lang\u003dgoh|brāto\u0027 () (German \u0027braten\u0027 (roast) , Old english (ca. 450-1100) \u0027lang\u003dang|brǣd\u0027 () Old norse \u0027bráð\u0027 (raw meat)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Strong muscles or lean flesh, especially of the arm, leg or thumb\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Physical strength; muscularity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Stephanie Laurens, \u0027A Secret Love\u0027, Avon Books (2000), ISBN 0380805707, [http://books.google.com/books?id\u003dUIA1KBh1iLAC\u0026amp;pg\u003dPA349 page 349\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The man was a bruiser, the sort who\u0027d learned his science in tavern brawls. Given his size and lack of agility, he relied on his \u0027\u0027brawn\u0027\u0027 to win. In any wrestling match, Crowley would triumph easily\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Michael Mandaville, \u0027Stealing Thunder\u0027, Dog Ear Publishing (2008), ISBN 9781598585353, [http://books.google.com/books?id\u003dU-xdpBsgoGUC\u0026amp;pg\u003dPA562 page 562\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The two men were husky, picked for their \u0027\u0027brawn\u0027\u0027 by the little man who sauntered into the room\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Martin Pasko \u0026amp; Robert Greenberger, \u0027The Essential Superman Encyclopedia\u0027, Del Ray (2010), ISBN 9780345501080, [http://books.google.com/books?id\u003daknpy8JiMWEC\u0026amp;pg\u003dPA218 page 218\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The youth agreed to the scheme and used his \u0027\u0027brawn\u0027\u0027 to begin moving pieces into place, starting by moving the planet Rann into the Thanagarian star system\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"head cheese; a terrine made from the head of a pig or calf; originally boar\u0027s meat\", \"priority\":9}]}, \"synonyms\":{}}");

	add("braxy", "{\"term\":\"braxy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An inflammatory disease of sheep\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Meat from sheep that have died from this disease, or that have died from accident or disease in general\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, \u0027The Eye in the Door\u0027, Penguin 2014 (\u0027The Regeneration Trilogy\u0027), p. 457\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If they suffocated before they could be slaughtered, their meat was unfit for human consumption, though it found its way on to the market as ‘\u0027\u0027braxy\u0027\u0027’, in shops patronized only by the very poor\", \"priority\":4}]}, \"synonyms\":{}}");

